import React from 'react';
import { library } from "@fortawesome/fontawesome-svg-core";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fab } from "@fortawesome/free-brands-svg-icons";
import './styles.css';

library.add(fab);

export default function Contact() {
    return (
        <div className="Body bg-dark p-5">
            <div>
                <div className="container-fluid pb-4">
                    <div className="row">
                        <a href="https://www.linkedin.com/in/nikolaj-jensen-73810b137/" target="_blank" className="col-sm" rel="noopener noreferrer">
                            <FontAwesomeIcon icon={["fab", "linkedin"]} color="green" size="4x" />
                        </a>
                        <a href="https://www.linkedin.com/in/nikolaj-jensen-73810b137/" target="_blank" className="col-sm" rel="noopener noreferrer">
                            <FontAwesomeIcon icon={["fab", "github"]} color="black" size="4x" />
                        </a>
                        <a href="https://www.linkedin.com/in/nikolaj-jensen-73810b137/" target="_blank" className="col-sm" rel="noopener noreferrer">
                            <FontAwesomeIcon icon={["fab", "twitter"]} color="blue" size="4x" />
                        </a>
                    </div>
                </div>
                <h4 className="text-light">Nikolaj Johannes Skole Jensen</h4>
                <h6 className="text-danger">Personal</h6>
                <h6 className="text-light">nikolajjsj@gmail.com</h6>
                <h6 className="text-danger">Developer</h6>
                <h6 className="text-light">nikolaj.app.dev@gmail.com</h6>
            </div>
        </div>
    )
}
